import React from "react";


class RandomCat extends React.Component {
  render() {

    return (
      <li>
        <a href="http://placekitten.com"> {this.props.name}</a>
        <img src={`${this.props.width}`} alt="Random cat" />
      </li>
    );
  }
}

export default RandomCat;
